import Vue from 'vue'
import Router from 'vue-router'
import HelloWorld from '@/components/HelloWorld'
import OTsubmmit from '@/components/OTsubmmit'
import leave from '@/components/leave/leave'
import leavePicker from '@/components/leave/leavePicker'
import leaveSubmmit from '@/components/leave/leaveSubmmit'
import leaveFinish from '@/components/leave/leaveFinish'
import leaveRecord from '@/components/leave/leaveRecord'
import agent from '@/components/agent'
import agentSetted from '@/components/agentSetted'
import compensatoryTime from '@/components/compensatoryTime'
import recording from '@/components/recording'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'HelloWorld',
      component: HelloWorld
    },
    {
      path: '/OTsubmmit',
      name: 'OTsubmmit',
      component: OTsubmmit
    },
    {
      path: '/leave',
      name: 'leave',
      component: leave,
      children: [
        {
          path: 'Picker',
          component: leavePicker
        },
        {
          path: 'Submmit',
          component: leaveSubmmit
        },
        {
          path: 'Finish',
          component: leaveFinish
        },
        {
          path: 'Record',
          component: leaveRecord
        }
      ]
    },
    {
      path: '/agent',
      name: 'agent',
      component: agent
    },
    {
      path: '/agentSetted',
      name: 'agentSetted',
      component: agentSetted
    },
    {
      path: '/compensatoryTime',
      name: 'compensatoryTime',
      component: compensatoryTime
    },
    {
      path: '/recording',
      name: 'recording',
      component: recording
    }
  ],
  mode: 'history'
})
